def find_rotation_count(arr):
    n = len(arr)
    low = 0
    high = n - 1

    while low <= high:
        mid = (low + high) // 2

        next_ = (mid + 1) % n
        prev_ = (mid - 1 + n) % n

        if arr[mid] <= arr[next_] and arr[mid] <= arr[prev_]:
            return mid

        if arr[mid] <= arr[high]:
            high = mid - 1
        elif arr[mid] >= arr[low]:
            low = mid + 1
    return 0

