def ncr_modp(n, r, p):
    # Create a list to store factorials
    fact = [0]*(n+1)
    fact[0] = 1

    # Compute factorials
    for i in range(1, n+1):
        fact[i] = (fact[i-1]*i)%p

    # Compute ncr
    ncr = fact[n]*modInverse(fact[r], p)%p*modInverse(fact[n-r], p)%p

    return ncr%p

# Function to compute modulo inverse
def modInverse(a, p):
    return pow(a, p-2, p)

